function Heat_draw(name, k, did){
	var radio = document.getElementsByName("week");
	var week;
	for (var i = 0; i < radio.length; i++)
		if (radio[i].checked) week = radio[i].value;
	if (week == "Fri") Heat_color = Heat_color1;
	else if (week == "Sat") Heat_color = Heat_color2;
	else Heat_color = Heat_color3;
	if (Heat_week != week){
		d3.selectAll(".Heat_rect")
			.transition()
			.duration(0)
			.remove();
		Heat_week = week;
		Heat_count = 0;
		Heat_cid = new Object();
		heatmapInstance.setData(Heat_setdata);
	}
	d3.csv("data/"+week+"/"+name+".csv", function(error, data) {
		if (error) return 0;
		//改变进度条位置
		Heat_v = k;
		d3.select("#handle-one")
			.style("left", k/Heat_width*100.0+"%");
		d3.select('#Slider_text')
				.text(Heat_format(Heat_slider_x.invert(k)))
				.style("left", k - 45 +"px");

		d3.select("#id"+did)
			.attr("width", Heat_item * 6)
			.attr("height", Heat_item * 6)
			.style("opacity", 0.6);

		data.forEach(function(d) {
			if (document.getElementById("id"+d.id)){
				Heat_cx[d.id] = Heat_x(d.X);
				Heat_cy[d.id] = Heat_y(d.Y);

				Heat_svg.select("#id"+d.id)
					.attr("x", Heat_x(d.X) - Heat_item/2 )
					.attr("y", Heat_y(d.Y) )
					.on("mouseover", function() {
						var w = d3.select(this).attr("width");
						d3.select(this)
						.attr("width", (w == Heat_item*6)?w:Heat_item* 5)
						.attr("height", (w == Heat_item*6)?w:Heat_item* 5)
						.style("opacity", 1);
						var xPosition = parseFloat(d3.select(this).attr("x")) + 20;
						var yPosition = parseFloat(d3.select(this).attr("y")) + 30;
						tooltip.style("opacity", 1)
							.style("left", xPosition + "px")
							.style("top", yPosition - 50 + "px")
							.select("#X")
							.text(d.X);
						tooltip.select("#Y")
							.text(d.Y);
						tooltip.select("#id")
							.text(d.id);
						ShowNum(Heat_x(d.X), Heat_y(d.Y));
					})
					.on("mouseout", function() {
						var w = d3.select(this).attr("width");
						d3.select(".Heat_tooltip").style("opacity", 0);
						Heat_n_div.style("opacity", 0);
						d3.select(this)
						.attr("width", (w == Heat_item*6)?w:Heat_item)
						.attr("height", (w == Heat_item*6)?w:Heat_item)
						.style("opacity", (w == Heat_item*6)?0.6:0.2);
					});
				// Heat_svg.select("#dot"+d.id)
				// 	.attr("cx",  Heat_x(d.X))
				// 	.attr("cy", Heat_y(d.Y));
			}
			else{
				Heat_cid[Heat_count] = d.id;
				Heat_cx[d.id] = Heat_x(d.X);
				Heat_cy[d.id] = Heat_y(d.Y);
				Heat_count ++;
				// Heat_svg.append("circle")
				// 	.attr("id", "dot"+d.id)
				// 	.attr("class", "Heat_dot")
				// 	.attr("r", 10)
				// 	.attr("cx",  Heat_x(d.X))
				// 	.attr("cy", Heat_y(d.Y))
				// 	.attr("fill", "red")
				// 	.style("opacity", 0.01);
				Heat_svg.append("rect")
					.attr("id", "id"+d.id)
					.attr("class", "Heat_rect")
					.attr("x", Heat_x(d.X) - Heat_item/2 )
					.attr("y", Heat_y(d.Y) )
					.attr("width", Heat_mask[d.id]?Heat_item*6:Heat_item)
					.attr("height", Heat_mask[d.id]?Heat_item*6:Heat_item)
					.attr("fill", Heat_color[d.id])
					.on("click", function(){
						d3.select(this)
						.attr("width", Heat_item * 6)
						.attr("height", Heat_item * 6)
						.style("opacity", 0.6);
						Dot_chart(d.id);
					})
					.on("mouseover", function() {
						var w = d3.select(this).attr("width");
						d3.select(this)
						.attr("width", (w == Heat_item*6)?w:Heat_item* 5)
						.attr("height", (w == Heat_item*6)?w:Heat_item* 5)
						.style("opacity", 1);
						var xPosition = parseFloat(d3.select(this).attr("x")) + 20;
						var yPosition = parseFloat(d3.select(this).attr("y")) + 30;
						tooltip.style("opacity", 1)
							.style("left", xPosition + "px")
							.style("top", yPosition - 50 + "px")
							.select("#X")
							.text(d.X);
						tooltip.select("#Y")
							.text(d.Y);
						tooltip.select("#id")
							.text(d.id);
						ShowNum(Heat_x(d.X), Heat_y(d.Y));
					})
					.on("mouseout", function() {
						var w = d3.select(this).attr("width");
						d3.select(".Heat_tooltip").style("opacity", 0);
						Heat_n_div.style("opacity", 0);
						d3.select(this)
						.attr("width", (w == Heat_item*6)?w:Heat_item)
						.attr("height", (w == Heat_item*6)?w:Heat_item)
						.style("opacity", (w == Heat_item*6)?0.6:0.2);
					});
				}
			});
		});
	}

