function ShowHeapMap(){
	heatmapInstance.setData(Heat_setdata);
	for (var i = 0; i < Heat_count; i++){
		var id = Heat_cid[i];
		heatmapInstance.addData({x: Heat_cx[id], y: Heat_cy[id]});
	}
}



function ShowNum(cx,cy){
	var n = heatmapInstance.getValueAt({x: cx, y: cy});
	heatmapInstance.addData({ x: cx, y: cy});
	if (n){
		Heat_n_div.style("opacity", 1);
		Heat_n_toolp.select("#Count").text(n);
	}
}